  are rare tumors that develop within the gastric mucosa. They can present as an isolated
  lesion or there can be multiple lesions. The tumor can invade locally into deeper
  structures of the gastrointestinal tract wall. Solitary gastric carcinoids have
  a greater chance for the development of malignancy and metastasis as compared to
  multiple gastric carcinoids due to hypergastrinemia.
