id: uuid:4c02de31-001a-4dc0-8418-d0e629c0cf29
type: NewTextDefinition
new_value: A fenestration affecting the basilar artery. Basilar fenestration typically
  occurs at the lower end of the basilar artery just as the vertebral arteries join
  Fenestrations of intracranial arteries are segmental duplications of the lumen into
  two distinct endothelium-lined channels, which may or may not share their adventitial
  layer. They can range from a small focus of divided tissue to long-segment duplication.
  Fenestrations are the result of partial failure of fusion of paired primitive embryologic
  vessels or incomplete obliteration of different anastomosis in a primitive vascular
  network. The association of fenestrations with aneurysms has been suggested in many
  small case series, though the exact relationship is not well defined.
about_node: HP:6000787

