id: uuid:30a4562e-595a-4aef-acf9-b0c35b433f93
type: NewTextDefinition
new_value: An elevation of the serum ascites albumin gradient (SAAG), which is based
  on the difference between the albumin level of serum and of ascitic fluid, may be
  used to assess the extent of ascites. The SAAG is thought to reflect the colloid
  osmotic pressure gradient and the degree of portal hypertension. It has been shown
  that SAAG is a better discriminator of portal hypertension than ascites. A SAAG
  of 1.1 gm/dL or higher is considered as high, indicating the presence of portal
  hypertension, while SAAG less than 1.1 gm/dL is low, indicating the absence of portal
  hypertension.
about_node: HP:6000863

