  uncharged species such as Glucose and Urea. Knowledge of the plasma concentration
  of these species allows calculation of the plasma osmolality quite accurately. If
  the difference between the measured osmolality (MO) and calculated osmolality (CO)
  is known as the osmolar gap (OG) is large (greater than 15) osmolar gap can help
  identify the presence in plasma of substances such as ethanol, methanol, isopropanol,
  ethylene glycol, propylene glycol..
